import React from "react";
import Spinner from "../Spinner/Spinner";

const WithSpinner = WrappedComponent => 
  ({ isFetching, ...otherProps }) => {

     return isFetching
        ? <Spinner />
        : <WrappedComponent {...otherProps} />

};

export default WithSpinner;
